import React from 'react'
import { Canvas } from "@react-three/fiber";
import { Stars } from "@react-three/drei";
import { Physics } from "@react-three/cannon";
import PlaneOne from "../Box/PlaneOne";
import "../App.css";
import { Player } from "../Box/Player";
import { useBox } from "@react-three/cannon";
import { Html } from "@react-three/drei";
import "./Instruction.css";
import "./Texts.css";




const index = () => {
  return (
    <>
        <Canvas>
        <Stars />
        <ambientLight intensity={0.5} />
        <Physics>
          <Inst />
          <About />
          <Education />
          <Project />
          <Certification />
          <Skill />
          <ContactMe />
          <PlaneOne />
          <Player position={[0, 2, -30]} />
        </Physics>
      </Canvas>
    </>
  )
}

export default index;


const Inst = () => {
    const [ref] = useBox(() => ({
      //mass: 1,
      position: [0, 2, -40],
    }));
    return (
      <>
        <mesh ref={ref}>
          <Html
            scale={1}
            rotation={[Math.PI / 8, 0, 0]}
            className="login-box"
            transform
            occlude
          >
            <div class="container spandiv ">
              <span></span>
              <span></span>
              <span></span>
              <span></span>
              <h1 class="neonText focuss">Not For Mobile</h1>
              <h2 class="neonText focuss">
                Click On Screen And turn around exit Screen press Esc
              </h2>
              <h2 class="neonText focuss">
                Movement Using W S A D & Space(Jump) Button
              </h2>
            </div>
          </Html>

          <meshLambertMaterial
            attach="material"
            color="black"
            transparent
            opacity={0.1}
            roughness={1}
            metalness={0}
          />
        </mesh>{" "}
      </>
    );
  };
  const About = () => {
    const [ref] = useBox(() => ({
      //mass: 1,
      position: [-9, 3, -22],
    }));
    return (
      <>
        <mesh ref={ref}>
          <Html scale={1} rotation={[Math.PI / 1, 1.5, 3.1]} transform occlude>
            <div className="the-neon-sign focuss">
              <h3 className="headTitle focuss"> SAURABH SINGH 😎</h3>
              {/* Saurabh Singh <span style={{ fontSize: '1.5em' }}>🥲 </span> */}
              <p className="focuss">MERN STACK DEVELOPER </p>
              <p className="focuss">
                {" "}
                I am Saurabh Kumar Singh who is at present looking for job in web
              </p>
              <p className="focuss">
                {" "}
                development and software development industry. Strong professional
              </p>
              <p className="focuss">
                {" "}
                with a Master’s Degree (M.C.A focused in software development from
              </p>
              <p className="focuss">
                {" "}
                Institute of Engineering and Technology, Lucknow, Uttar-Pradesh).
              </p>
              <br />
              <p className="focuss">
                I am looking forward to work with the organization. This
                unambiguously
              </p>{" "}
              <p className="focuss">
                would provide me an opportunity to further explore my knowledge
                and skills.
              </p>{" "}
            </div>
          </Html>

          <meshLambertMaterial
            attach="material"
            color="black"
            transparent
            opacity={0.1}
            roughness={1}
            metalness={0}
          />
        </mesh>{" "}
      </>
    );
  };

  const Education = () => {
    const [ref] = useBox(() => ({
      //mass: 1,
      position: [8, 3, -15],
    }));
    return (
      <>
        <mesh ref={ref}>
          <Html scale={1} rotation={[Math.PI / 1, 4.6, 3.1]} transform occlude>
            {/* Saurabh Singh <span style={{ fontSize: '1.5em' }}>🥲💻📜 </span> */}
            <div className="the-neon-sign">
              <h3 className="headTitle focuss"> EDUCATION 🎓</h3>
              <h3 className="focuss">Masters of Computer Application</h3>
              <p className="focuss">
                {" "}
                Institute of Engineering & Technology, Lucknow Utter- Pradesh
              </p>
              <p className="focuss">2017 - 2021 </p>
              <h3 className="focuss">Bachelors of Science •May 2017 </h3>
              <p className="focuss">
                {" "}
                Dr. Rammanohar Lohia Avadh University”, Ayodhya Uttar-Pradesh.
              </p>
              <p className="focuss">2014 - 2017 </p>
              <br />{" "}
            </div>
          </Html>

          <meshLambertMaterial
            attach="material"
            color="black"
            transparent
            opacity={0.1}
            roughness={1}
            metalness={0}
          />
        </mesh>{" "}
      </>
    );
  };

  const Project = () => {
    const [ref] = useBox(() => ({
      //mass: 1,
      position: [22, 4, -11],
    }));
    return (
      <>
        <mesh ref={ref}>
          <Html scale={1} rotation={[Math.PI / 1, 3.1, 3.1]} transform occlude>
            <div className="the-neon-sign">
              <h2 className="focuss"> Projects </h2>

              <div>
                <h3 className="focuss"> Meta Game Fantasy (M G F) </h3>

                <p className="focuss">
                  Meta Game Fantasy is the gaming application in founded on a
                  solidarity game, special competitons, and formats.
                </p>
                <p className="focuss">
                  Working on backend Node.js, Express is used for the server &
                  postgres, postgres create schema and data modeling
                </p>

                <h3 className="focuss"> Gas-O-Line </h3>

                <p className="focuss">
                  {" "}
                  Gas-O-Line is the webApp provides monthly subscription gas at
                  low prices.
                </p>
                <p className="focuss">
                  {" "}
                  Drilling for oil and gas production in Texas,Nevada, New Mexico
                  Alaska and Louisiana
                </p>
                <p className="focuss">
                  Working on backend Node.js, stripe payment gateway for
                  subscription. API for creating user, product and webhook
                  implementation
                </p>
              </div>

              <h2 className="focuss"> Personal Projects </h2>

              <h3 className="focuss"> Memories(mern) </h3>

              <p className="focuss">
                {" "}
                Development using technologies like React with Javascript,
                Material UI, CSS3 Managed application state with Redux{" "}
              </p>
              <p className="focuss">
                {" "}
                For back end Node.js, Express is used for the server & MongoDB,
                Mongoose create schema and data modeling
              </p>
              <h3 className="focuss"> E-commerce</h3>

              <p className="focuss">
                {" "}
                Front end UI development using technologies Using React.js, redux,
                and Firebases. LinkedIn Clone Front end{" "}
              </p>
            </div>
          </Html>

          <meshLambertMaterial
            attach="material"
            color="black"
            transparent
            opacity={0.1}
            roughness={1}
            metalness={0}
          />
        </mesh>{" "}
      </>
    );
  };

  const Certification = () => {
    const [ref] = useBox(() => ({
      //mass: 1,
      position: [22, 2, 11],
    }));
    return (
      <>
        <mesh ref={ref}>
          <Html scale={1} rotation={[Math.PI / 1, 0, 3.1]} transform occlude>
            <div className="the-neon-sign">
              <h3 className="headTitle focuss"> CERTIFICATION 🏅</h3>
              {/* Saurabh Singh <span style={{ fontSize: '1.5em' }}>🥲 </span> */}
              <h4 className="focuss">
                {" "}
                🔰 Front-End Web Development with React{" "}
              </h4>
              <p className="focuss">4 WEEKS</p>
              <p className="focuss">
                {" "}
                The Hong Kong University of Science and Technology, Coursera.
              </p>
              <h4 className="focuss">
                {" "}
                🔰 Server-side Development with NodeJS, Express and MongoDB{" "}
              </h4>
              <p className="focuss">4 WEEKS</p>
              <p className="focuss">
                {" "}
                The Hong Kong University of Science and Technology, Coursera.
              </p>
              <h4 className="focuss">
                {" "}
                🔰 Front-End Web UI Frameworks and Tools: Bootstrap 4{" "}
              </h4>
              <p className="focuss">4 WEEKS</p>
              <p className="focuss">
                {" "}
                The Hong Kong University of Science and Technology, Coursera.
              </p>{" "}
            </div>
          </Html>

          <meshLambertMaterial
            attach="material"
            color="black"
            transparent
            opacity={0.1}
            roughness={1}
            metalness={0}
          />
        </mesh>{" "}
      </>
    );
  };

  const Skill = () => {
    const [ref] = useBox(() => ({
      //mass: 1,
      position: [9, 3, 9],
    }));
    return (
      <>
        <mesh ref={ref}>
          <Html scale={1} rotation={[Math.PI / 1, 4.6, 3.1]} transform occlude>
            <div className="the-neon-sign">
              <h3 className="focuss"> SKILLS SUMMARY 🎯 </h3>
              {/* Saurabh Singh <span style={{ fontSize: '1.5em' }}>🥲 ⭐ ☆★ </span> */}

              <h4 className="focuss"> ★★★★☆ ---------------- Javascript</h4>
              <h4 className="focuss"> ★★★☆☆ ---------------- Node JS</h4>
              <h4 className="focuss"> ★★☆☆☆ ---------------- React JS</h4>
              <h4 className="focuss"> ★★☆☆☆ ---------------- React-redux</h4>
              <h4 className="focuss"> ★★★☆☆ ---------------- Express</h4>
              <h4 className="focuss"> ★★★☆☆ ---------------- MySql,Postgres</h4>
              <h4 className="focuss">
                {" "}
                ★★★☆☆ ---------------- object oriented programming
              </h4>
              <h4 className="focuss">
                {" "}
                ★★★☆☆ ---------------- HTML5, Bootstrap, CSS
              </h4>
            </div>
          </Html>

          <meshLambertMaterial
            attach="material"
            color="black"
            transparent
            opacity={0.1}
            roughness={1}
            metalness={0}
          />
        </mesh>{" "}
      </>
    );
  };

  const ContactMe = () => {
    const [ref] = useBox(() => ({
      //mass: 1,
      position: [-9, 2, 7],
    }));
    return (
      <>
        <mesh ref={ref}>
          <Html scale={1} rotation={[Math.PI / 1, 0, 3.1]} transform occlude>
            <div className="the-neon-sign">
              <h3 className="headTitle"> CONTACT ME AT 🇮🇳 </h3>

              {/* Saurabh Singh <span style={{ fontSize: '1.5em' }}>🥲 ⭐ ☆★ </span> */}

              <h4 className="focuss"> 🗺 hauz khas, Delhi </h4>
              <h4 className="focuss"> 📧 ssgkp.singh@gmail.com </h4>
              <h4 className="focuss">
                {" "}
                🔗 https://www.linkedin.com/in/saurabh-singh-841590192/{" "}
              </h4>
              <h4 className="focuss"> ✅ https://github.com/saurabhgkp </h4>
              <h4 className="focuss"> 📱 91+ 7784824509 </h4>
            </div>
          </Html>

          <meshLambertMaterial
            attach="material"
            color="black"
            transparent
            opacity={0.1}
            roughness={1}
            metalness={0}
          />
        </mesh>{" "}
      </>
    );
  };
